import React from 'react'
import { v4 as uuidv4 } from 'uuid';

// importing images:
import coffeeImg from '../img/art/coffee.jpg'
import buildingImg from '../img/art/building.jpg'

const ArtItems = [
  {title: "building", description: "", image: buildingImg},
  {title: "coffee", description: "", image: coffeeImg}
  // {title: "More", description: "", image: ArtDirectory + "fallentree.jpg"}
]

const Art = () => {
  return (
    <div>
      {/* <img src={require('../img/art/building.jpg')} alt="nope"/> */}
      {ArtItems.map((artItem, i) => {
        return <img 
          key={uuidv4()}
          src={(artItem.image)}
          alt={artItem.title}
          />
      })}
    </div>
  )
}

export default Art
